import React, { Component } from 'react';
import Coin from './Coin';

class Coinflip extends Component {
    constructor(props){
        super(props);
        this.state = {};
    }
    static defaultProps = {
        head:'https://tinyurl.com/react-coin-heads-jpg',
        tail:'https://www.pcgscoinfacts.com/UserImages/71009269r.jpg?__cf_chl_jschl_tk__=d3b08e6e6457d69a7f65e8fee162d907f563df69-1586568555-0-AY5nxFIUgfm7LpetrrYFLlmnZMQ4JLH-mtl-DyniL-6PxtGTIWQuzo1Y2pS3TNUsnpmmw-DuYR1JEnAHC0OOIDI5-B2VithFmcNF2FT3YxHowFgGfoxe--cA6j2G4JhSvqcTNFQTI6VS8Efizd0nzwSAbViWYuJIj5eRhapFWQc69kUzzenr__4M71WapiZlwZi82Vwy_JKLd48qKy3OYUEf3E6ROLFmVx-ILvWBasAjISFcvNLS18jKIjq8DU73J4BZFBbxbQOW6DxacPGBI1aNU5Pg0prwUuW9rHIGGXz_uH7iFATx32soTVDO_GERvg'
    }
    render(){
        return(
            <div className="Coinflip">
                <h2>Let's flip a coin!</h2>
                <Coin />
            </div>
        );
    }
}

export default Coinflip;
